import Paths from "Components/Paths";
import React from "react";

const PathsContainer = ({ canvasRef }) => {
  const canvas = canvasRef.current;
  ctx.beginPath();
  ctx.arc(1, 2, 2, 0, Math.PI * 2);

  return (
    <>
      <Paths canvas={canvas} ctx={ctx} />
    </>
  );
};

export default PathsContainer;
